    static double jd2et(double jd)
    {
        return (jd - 2451545.0) / 365250.0;

    }

    static void check(double a, double b)
    {
        double t1 = a % Math.PI;
        double t2 = b % Math.PI;

        if (t1 < 0) t1 += Math.PI;
        if (t2 < 0) t2 += Math.PI;

        if (Math.abs(t1-t2) > .0000000009)
        {
            System.out.println("Fail:"+a+" "+b);
            pass=false;
        } else
        {
            //Console.WriteLine("Pass");
        }
    }

